/*Table structure for table `chat_messages` */

CREATE TABLE `chat_messages` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned DEFAULT NULL,
  `room` varchar(50) COLLATE utf8_hungarian_ci DEFAULT NULL,
  `type` varchar(10) COLLATE utf8_hungarian_ci DEFAULT NULL,
  `message` mediumtext COLLATE utf8_hungarian_ci,
  `file` mediumblob,
  `created` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=158 DEFAULT CHARSET=utf8 COLLATE=utf8_hungarian_ci;

