insert  into `chat_messages`(`id`,`user_id`,`room`,`type`,`message`,`file`,`created`) values (66,1,'room-1-1459180786761','message','Amon did not view himself or his actions as evil. He believed that the Infinite Cycle brought unnecessary suffering and was corrupt. He often claimed to his followers and foes alike that by destroying the creations of the xel\'naga, he was bringing an end to their suffering. According to Rohana, however, Amon actually desired to destroy life out of an intense hatred for the xel\'naga.[12] There is evidence that Amon\'s resentment towards the xel\'naga and the Infinite Cycle is in part due to his transformation into a xel\'naga himself, a process which Amon claimed was forced on him.[9]',NULL,'2016-03-28 17:59:55');
